    <title>Gif to SVG Animation</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
        background-color: beige;
      }

      .wrapper {
        width: 100%;
      }

      #top-ball {
        transform-box: fill-box;
        transform-origin: center;
        transform: translate(-45px, 10px) rotate(-60deg);
        animation: ballRoll 6s ease-in-out infinite alternate;
      }

      @keyframes ballRoll {
        0% {
          transform: translate(-45px, 10px) rotate(-60deg);
        }

        100% {
          transform: translate(45px, 5px) rotate(60deg);
        }
      }

      #body {
        transform-box: fill-box;
        transform-origin: center bottom;
        transform: rotate(-10deg);
        animation: rounding 6s ease-in-out infinite alternate;
      }

      @keyframes rounding {
        0% {
          transform: rotate(-10deg);
        }

        100% {
          transform: rotate(10deg);
        }
      }
    </style>
